    <script>window.__NUXT__=(function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r){r.id=77;r.slug=a;r.title=g;r.url=a;r.protocol=c;r.type={code:h,description:"Роут"};r.createdAt="2021-09-30T19:13:44+03:00";r.updatedAt="2021-09-30T19:39:09+03:00";r.meta={title:a,description:a,keywords:a};r.content={id:346,text:a,blocks:[]};r.children=[];return {layout:"default",data:[{post:{title:"Позиционирование бренда. 6 шагов к успеху",slug:"pozicionirovanie-brenda-6-shagov-k-uspehu",shortDescription:"Планируя выйти на рынок, каждый предприниматель невольно задумывается о будущем своего бизнеса. Сколько проживет компания? Ответ Ричарда Фостера, который является профессором Йельской школы менеджмента, не утешителен. По его мнению, средний срок жизни брендов с 1920-х годов снизился более чем в четыре раза и составляет на сегодняшний день 15 лет. Впрочем, есть и хорошая новость.",createdAt:"2021-11-16T11:16:06+03:00",isImported:f,image:{file:{url:"\u002Fuploads\u002Ffile\u002F3\u002Fa\u002F3\u002F3a36a6f7b7d7c9e413e3333ba6f9e9f3.png",name:"3a36a6f7b7d7c9e413e3333ba6f9e9f3.png",originalName:"avatar.png",extension:"png",size:"207.6 Кб"}},content:{id:438,text:"\u003Cp\u003EПланируя выйти на&nbsp;рынок, каждый предприниматель невольно задумывается о&nbsp;будущем своего бизнеса. Сколько проживет компания? Ответ Ричарда Фостера, который является профессором Йельской школы менеджмента, не&nbsp;утешителен. По&nbsp;его мнению, средний срок жизни брендов с&nbsp;1920-х годов снизился более чем в&nbsp;четыре раза и&nbsp;составляет на&nbsp;сегодняшний день 15&nbsp;лет. Впрочем, есть и&nbsp;хорошая новость. Сильные бренды являются исключением из&nbsp;общего правила. Они живут долго. Иногда очень долго. Безусловно, потеснить с&nbsp;рынка Adidas, Toyota или Coca-Cola трудно. Но&nbsp;приблизиться к&nbsp;ним вполне реально. Как это сделать? С&nbsp;помощью грамотного позиционирования!\u003C\u002Fp\u003E\r\n\u003Ch3\u003EЧто такое позиционирование и почему это важно?\u003C\u002Fh3\u003E\r\n\u003Cp\u003EПозиционирование бренда &mdash; маркетинговая стратегия, цель которой заключается в том, чтобы максимально выделить компанию или ее продукт на фоне конкурентов, сделать их более заметными и привлекательными для целевой аудитории. Почему так важно разработать эффективную стратегию? Если коротко, то грамотное позиционирование сообщает потребителю, по какой причине он должен купить товар именно этого бренда.\u003C\u002Fp\u003E\r\n\u003Cp\u003EКакие задачи решает позиционирование бренда? Прежде всего оно помогает:\u003C\u002Fp\u003E\r\n\u003Cul\u003E\r\n\u003Cli\u003EДистанцироваться от конкурентов. Современный рынок переполнен предложениями. В таких условиях не иметь собственного лица и быть похожим на десятки других компаний &mdash; это непозволительная роскошь. Грамотное позиционирование позволяет проанализировать ситуацию и найти свою нишу.\u003C\u002Fli\u003E\r\n\u003Cli\u003EСформировать эмоциональную связь с&nbsp;целевой аудиторией. Профессиональная разработка позиционирования дает возможность эффективно взаимодействовать с&nbsp;потребителями. В&nbsp;том числе выстроить такие отношения, при которых покупатель не&nbsp;просто приобретает товар, но&nbsp;и&nbsp;советует его окружающим.\u003C\u002Fli\u003E\r\n\u003Cli\u003EСоздать дополнительную ценность. Если говорить откровенно, то&nbsp;в&nbsp;техническом плане iPhone совсем небезупречен. Но&nbsp;это не&nbsp;мешает Apple продавать смартфоны по&nbsp;цене, которая в&nbsp;несколько раз выше себестоимости. Причина&nbsp;&mdash; грамотное позиционирование, позволяющее обладателям &laquo;яблочной&raquo; техники ощущать себя более прогрессивными, свободными, обеспеченными.\u003C\u002Fli\u003E\r\n\u003C\u002Ful\u003E\r\n\u003Cp\u003EОбратите внимание! Вышесказанное относится к&nbsp;любому направлению деятельности и&nbsp;сегменту рынка. Речь может идти о&nbsp;производителе одежды, автомобилей, мороженого, жвачки и&nbsp;даже о&nbsp;личных брендах. В&nbsp;любом случае позиционирование помогает вывести бизнес на&nbsp;новый уровень.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAA\\u002Fzne8s\u002FdiP\u002FdjSj\u002F\u002F4j79s\u002FCyNr5fH64zPf+InfoLfZy960YuWv\u002Fvd785++qd\u002Fevb9739\u002F9h\u002F\u002F8R\u002FLP\u002FmTPzm1Nc6d8d1LXvKS6XV8N\u002FuZn\u002FkZzp9xzL\u002F927+t88p5L37xiw+OUw7+y7\u002F8y2xcm8\u002FWx\u002FezH\u002FzgB+sb13n43\u002F\u002F93w+O7w6OdjlufejgrKqqqqqq6gWsAqyqqqqqqo44LS8vLw1gtDzervzUT\u002F3UywYIWh6QaOl73\u002FveyoBLgKploBM\u002FCICEgFbI7wBMQCjAEz\u002Fj\u002FPk5AzQBnaZXPh+ga3bUUUfN\u002Fvmf\u002F3l+PMf6+opXvGL25JNPTr9zLNfklTb42YBYEwT79re\u002FPX1nP2h\u002F9G19gK31cQxwa53fx3EPj\u002Fvk9\u002F1DhVxVVVVVVR2xKsCqqqqqquqwlJDqpS996cp3v\u002Fvds8YPYGplAKJlXFOAIoAUAOhf\u002F\u002FVfp3NwT+GQ4jscUQNuzQYUmrfJsRzDzz\u002F8wz\u002FMP3\u002Fxi188gSycVXksn224qCaQxWdCrQBP08\u002FLXvayqU3apj+L8It2\u002Fumf\u002Fmlqm9+5Fu1yHH3lWPoL3PLe\u002FNkAZji21n\u002FlV35l\u002FcCBA\u002Fv\u002F8i\u002F\u002F8uExNusHDx7cXwdXVVVVVVWHuwqwqqqqqqo6pCWoGoBn5fLLLz\u002Fr4x\u002F\u002FOC6qlQGeAFZzCAToEQQBqRJMAaA20v7mkEm3kw4rzkWnn3767OUvf\u002Fnsi1\u002F84vQd7XMc59Iu1\u002Fq5n\u002Fu5yWnFe0Q\u002FSBkELgmtAFWcz\u002FX4nfNpi75kf3Vr8R3tI11evgdgcb4wSycYri0hFp\u002FxO\u002F3\u002Fx3\u002F8x3lfOI+0xdH+\u002FuOOO27\u002FgGTr3\u002FzmN2+ra6uqqqqqqsNJBVhVVVVVVR0yAlYNqIOL6izcVAO6rA4oswz0QT\u002F7sz87uZiAOMIe0\u002FxI3wPgCKmsPwXI4nw\u002FBxQBjJAADAmEaI9zdG699KUvnYMiIdKePXtmn\u002F\u002F85+dphPwIztJ9hXR98TltvPnNb579\u002Fd\u002F\u002F\u002Fexb3\u002FrWBMbsM23wKqyij9wT5\u002FIj1OLV8XAMdGF5L0I90xe5Dv2gXcaF87neeL9\u002FHL4+7vHm0Z\u002Fb+L1uraqqqqqqDkUVYFVVVVVV9bxpZWVl+dvf\u002FvbqeHvJgDCrA7osC5h4BbgIqHQZmf4HZLJmlW4mXVcCGoEO7eiwAugIswRY1rcyNY9jeQX8AJoQoIlzuAbXFzjpirJt2rDPwqY8xxRC0xG5Fj8cn2mFvOq20iFmIXiOA6yRcsjnnqN0dfkdxwvV+Jx0RhxaAj36cs4558y+8IUvkKa4H7fWOOfm0c\u002FbvvzlL++fVVVVVVVVPc8qwKqqqqqq6jnTjh07VgccOWsAntXvfve7q+OjaYc\u002FgU0WPuczHEjHHXfcbH19fcaufabcpYsKCXCoESVAAholYAJAAW6A